import math
def min_cost(cost, m, n):
    # Base cases
    if (m < 0 or m >= len(cost)):
        return math.inf
    if (n < 0 or n >= len(cost[0])):
        return math.inf
    if (m == 0 and n == 0):
        return cost[0][0]

    # Recursively calculate the cost to reach (m, n) from (0, 0)
    return cost[m][n] + min(
        min_cost(cost, m - 1, n),
        min_cost(cost, m, n - 1),
        min_cost(cost, m - 1, n - 1)
    )

