def find_missing(ar,N):
    # if last element is missing
    if ar[N-1] == N:
        return N+1

    # if first element is missing
    if ar[0] != 0:
        return 0

    low =0
    high = N-1

    while low <= high:
        mid = int((low+high)/2)

        # if ar[mid] is not equal to mid, missing element is present before mid
        if ar[mid] != mid:
            high = mid -1

        # if ar[mid] is equal to mid, missing element is present after mid
        else:
            low = mid +1

    # missing element is just after the loop breaks
    return low

