def max_occurrences(nums):
    """
    Finds the item with the maximum number of occurrences in a given list.

    Parameters:
    nums: a list of elements

    Returns:
    The item with the maximum number of occurrences.
    """

    # Create a dictionary to store the frequency of each item.
    freq = {}
    for num in nums:
        if num not in freq:
            freq[num] = 0
        freq[num] += 1

    # Find the item with the maximum frequency.
    max_freq = 0
    max_item = None
    for item, freq in freq.items():
        if freq > max_freq:
            max_freq = freq
            max_item = item

    return max_item

