	# Stores the maximum sum of bi-tonic sub-sequence ending at index i, where the subsequence is increasing till index i
	dp = [None] * n

	# Stores the maximum sum of bi-tonic sub-sequence ending at index i, where the subsequence is decreasing till index i
	dp_rev = [None] * n

	# Initialize dp[0] and dp_rev[n-1]
	dp[0] = arr[0]
	dp_rev[n-1] = arr[n-1]

