	for i in range(1, n):
		dp[i] = arr[i]
		for j in range(i):
			if arr[i] > arr[j]:
				dp[i] = max(dp[i], dp[j] + arr[i])

	# Compute dp_rev[i] for all i from n-2 to 0
	for i in range(n-2, -1, -1):
		dp_rev[i] = arr[i]
		for j in range(i+1, n):
			if arr[i] > arr[j]:
				dp_rev[i] = max(dp_rev[i], dp_rev[j] + arr[i])

	# Find the maximum sum of bi-tonic sequence
	max_sum = 0
	for i in range(n):
		max_sum = max(max_sum, dp[i] + dp_rev[i] - arr[i])

	return max_sum

