def get_maxgold(gold, m, n):
    """
    :param gold: A 2D array representing the gold mine.
    :param m: The number of rows in the gold mine.
    :param n: The number of columns in the gold mine.
    :return: The maximum amount of gold that can be collected.
    """

    # Create a 2D array to store the maximum amount of gold that can be collected from each cell.
    dp = [[0 for _ in range(n)] for _ in range(m)]

    # Iterate over the cells in the gold mine in reverse order.
    for i in range(m - 1, -1, -1):
        for j in range(n):
            # If the cell is in the leftmost column, then the maximum amount of gold that can be collected from it is the
            # amount of gold in the cell.
            if j == 0:
                dp[i][j] = gold[i][j]
            # If the cell is in the rightmost column, then the maximum amount of gold that can be collected from it is the
            # amount of gold in the cell plus the maximum amount of gold that can be collected from the cell above it.
            elif j == n - 1:
                dp[i][j] = gold[i][j] + dp[i - 1][j]
            # Otherwise, the maximum amount of gold that can be collected from the cell is the amount of gold in the cell plus
            # the maximum amount of gold that can be collected from the cell above it or the cell to the left of it.
            else:
                dp[i][j] = gold[i][j] + max(dp[i - 1][j], dp[i][j - 1])

    # Return the maximum amount of gold that can be collected from the gold mine.
    return max(dp[m - 1])

