def shell_sort(my_list):
    n = len(my_list)
    # Define the gap sequence, in this case using the Knuth sequence.
    gaps = [701, 301, 132, 57, 23, 10, 4, 1]
    # Iterate over the gap sequence in reverse order.
    for gap in gaps[::-1]:
        # Iterate over the elements of the array.
        for i in range(gap, n):
            # Insert the element at the correct position.
            key = my_list[i]
            j = i
            while j >= gap and my_list[j - gap] > key:
                my_list[j] = my_list[j - gap]
                j -= gap
            my_list[j] = key
    # Return the sorted array.
    return my_list

