    """
    This function returns the sum of the even factors of the number n.

    Args:
        n (int): The number whose factors we want to sum.

    Returns:
        int: The sum of the even factors of n.
    """

    sum = 0

    for i in range(1, int(n ** 0.5) + 1):
        if n % i == 0:
            if i % 2 == 0:
                sum += i
            if n // i != i and (n // i) % 2 == 0:
                sum += (n // i)

