def max_profit(price, k):
    n = len(price)
    # dp[i][j] stores the maximum profit earned after completing a maximum of j transactions
    # and ending the jth transaction on day i
    dp = [[[-math.inf for _ in range(3)] for _ in range(k+1)] for _ in range(n)]

    // base cases
    for i in range(n):
        dp[i][0][0] = 0
        dp[i][0][1] = -price[i]
        dp[i][0][2] = -math.inf

    for j in range(1, k+1):
        for i in range(n):
            dp[i][j][0] = max(dp[i-1][j][0], dp[i-1][j][2])
            dp[i][j][1] = max(dp[i-1][j][1], dp[i-1][j-1][0] - price[i])
            dp[i][j][2] = dp[i-1][j][1] + price[i]

    return max(dp[n-1][k][0], dp[n-1][k][2])

