  """
  Checks if the two given strings are permutations of each other.

  Args:
    str1 (str): The first string.
    str2 (str): The second string.

  Returns:
    bool: True if the two strings are permutations of each other, False otherwise.
  """

  # Check if the two strings are the same length.
  if len(str1) != len(str2):
    return False

  # Create a dictionary to store the counts of each character in str1.
  char_counts = {}
  for char in str1:
    if char not in char_counts:
      char_counts[char] = 0
    char_counts[char] += 1

  # Check if the counts of each character in str2 match the counts in str1.
  for char in str2:
    if char not in char_counts or char_counts[char] == 0:
      return False
