import math
def floor_Min(A,B,N):
    // if B is divisible by A, then minimum value remains same for all elements
    if B % A == 0:
        return math.floor(B / A)
    else:
        // first interval will have B % A elements
        // so, for remaining elements interval will start from B % A + 1
        start = B % A + 1
        // if length of interval is even
        if (B - start + 1) % 2 == 0:
            // we will get minimum value in middle of this interval
            return math.floor(start + (B - start) / 2) / A
        else:
            // if length is odd, we may get 2 possible answers
            // either middle or (middle + 1) / A
            return math.floor((start + (B - start) / 2) / A)

