def replace(string, char):

    # Check for edge cases.
    if not string or string == "":
        return string

    # Create a set to store unique characters.
    char_set = set()

    # Iterate over string and add each unique character to the set.
    for c in string:
        char_set.add(c)

    # Create a new empty string.
    result = ""

    # Iterate over the original string again and add each character
    # that is not present in the set to result.
    for c in string:
        if c not in char_set:
            result += c

    # Remove the given character from result.
