import heapq
def second_frequent(input):
    """
    Given a sequence of strings, the task is to find out the second most repeated (or frequent) string in the given sequence.
    Available, imported libraries: math, re, heapq, bisect
    """
    # Create a dictionary to store the frequency of each string
    freq = {}
    for s in input:
        if s not in freq:
            freq[s] = 0
        freq[s] += 1

    # Use a heap to store the top two most frequent strings
    heap = []
    for s, f in freq.items():
        heapq.heappush(heap, (-f, s))
        if len(heap) > 2:
            heapq.heappop(heap)

    # Return the second most frequent string
    return heap[1][1]

