def smallest_multiple(n):
    if n <= 0:
        return 1

    # Create a list of prime numbers up to n.
    primes = []
    for i in range(2, n+1):
        is_prime = True
        for j in range(2, int(i**0.5) + 1):
            if i % j == 0:
                is_prime = False
                break
        if is_prime:
            primes.append(i)

    # Create a dictionary of prime factors and their exponents.
    prime_factors = {}
    for prime in primes:
        exp = 0
        while n % prime == 0:
            n = n // prime
            exp += 1
        prime_factors[prime] = exp

    # Find the smallest multiple by multiplying the prime factors with their exponents.
    smallest_multiple = 1
    for prime, exp in prime_factors.items():
        smallest_multiple *= prime ** exp

    return smallest_multiple

